import { Component, OnInit } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { DomSanitizer, SafeResourceUrl } from '@angular/platform-browser';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  title = 'unit-test';
  imagepath:SafeResourceUrl='';
  imageUrl='';
  constructor(private http: HttpClient,private _sanatizer:DomSanitizer) {

  }
  ngOnInit(): void {
    this.http.get("https://localhost:44307/api/home/").subscribe(res => this.Success(res), res => console.log(res));

    this.imagepath=this._sanatizer.bypassSecurityTrustResourceUrl('data:image/jpg;base64,'+this.imageUrl);
  }

  Success(input: any) {
    console.log(atob(input.value));
  }

  uploadFile(files:any){
    if(files.length==0){
      return ;
    }

    let fileToUpload=<File>files[0];
    const formData=new FormData();

    formData.append('file',fileToUpload,fileToUpload.name)

    this.http.post('https://localhost:44307/api/home/',formData).subscribe(res=>console.log(res),res=>console.log(res));
  }


}


